import React from "react";
import { InfoWindow } from "react-google-maps";

const Info = (props) => {
  if (props.click) {
    return (
      <InfoWindow
        position={{
          lat: props.lat,
          lng: props.lng,
        }}
      >
        <div>city details</div>
      </InfoWindow>
    );
  } else {
    return null;
  }
};

export default Info;
